import React, { Component } from 'react';
import './Contact.css';
import { Navbar } from 'react-bootstrap';

class Contact3 extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Navbar.Collapse className='justify-content-end'>
                <button type="button" className={`nav-link active text-center text-hover-color customButton ${this.props.active ? 'button-active' : 'text-secondary'}`} onClick={this.props.callback} >CONTACT</button>
            </Navbar.Collapse>
        );
    }
}

const Contact = ({active, callback}) => {
    return (
        <Navbar.Collapse className='justify-content-end'>
            <button type="button" className={`nav-link active text-center text-hover-color customButton ${active ? 'button-active' : 'text-secondary'}`} onClick={callback} >CONTACT</button>
        </Navbar.Collapse>
    );
}

export default Contact;
